insert into ubytovani (nazev, popis, adresa_id, pocet_hvezd) values ('Královský Ráj Apartmán', 'Toto luxusní zařízení, nacházející se v v horách, přináší neopakovatelný zážitek. S spa a wellness centrum a soukromé pláže, je toto místo ideální pro milovníky přírody. Pokud hledáte relaxaci nebo zábavu, náš hotel nabízí právě to. Každý pokoj je designově přizpůsoben pro moderní technologie a poskytuje soukromí a klid. V hotelu naleznete také konferenční místnosti a fitness centrum, které zaručí, že váš pobyt bude nezapomenutelný. Pro gurmány máme venkovní terasu, kde ochutnáte místní i mezinárodní speciality. Hotel je také vhodný pro svatby, nabízející profesionální obsluhu. Naši zaměstnanci se zavázali poskytovat personalizovaný přístup, což zajišťuje, že každý host se cítí jako doma. Nenechte si ujít příležitost prožít toto jedinečné místo, kde se splní všechny vaše přání.', 200, 3);
insert into ubytovani (nazev, popis, adresa_id, pocet_hvezd) values ('Městský Les Apartmán', 'Toto útulný zařízení, nacházející se v v centru města, přináší neopakovatelný zážitek. S nekonečné bazény a spa a wellness centrum, je toto místo ideální pro rodiny s dětmi. Pokud hledáte luxus nebo komfort, náš hotel nabízí právě to. Každý pokoj je designově přizpůsoben pro nádherný výhled a poskytuje pocit luxusu. V hotelu naleznete také dětský koutek a krytý bazén, které zaručí, že váš pobyt bude nezapomenutelný. Pro gurmány máme bar, kde ochutnáte místní i mezinárodní speciality. Hotel je také vhodný pro rodinné oslavy, nabízející gurmánské cateringové služby. Naši zaměstnanci se zavázali poskytovat profesionální péči, což zajišťuje, že každý host se cítí jako doma. Nenechte si ujít příležitost prožít toto jedinečné místo, kde se splní všechny vaše přání.', 201, 2);
